import 'bootstrap/dist/css/bootstrap.css';

const Footer = () =>{
    return ( 
        <div className ="container-fluid bg-primary footer">
            <div className='row'>
                <div className='col-6 align-items-center d-flex justify-content-center'>
                    <div className=' d-flex justify-content-center'>
                        <h1>Our Address</h1>

                    </div>
                </div>
                <div className='col-6 align-items-center d-flex justify-content-center' >
                    <img src='https://www.sendible.com/hs-fs/hubfs/blog-import/2020/20-08-Aug/sm-icons-facebook-logo.png?width=180&name=sm-icons-facebook-logo.png' />
                    <img src='https://www.sendible.com/hs-fs/hubfs/blog-import/2022/07-22-Jul/every-social-media-logo-and-icon-in-one-handy-place-instagram-app-logo.png?width=174&name=every-social-media-logo-and-icon-in-one-handy-place-instagram-app-logo.png' />
                    <img src='https://www.sendible.com/hs-fs/hubfs/Imported_Blog_Media/twitter-1.png?width=180&height=180&name=twitter-1.png' />
                    <img src='https://www.sendible.com/hs-fs/hubfs/blog-import/2020/20-08-Aug/sm-icons-linkedin-in-logo.png?width=120&name=sm-icons-linkedin-in-logo.png' />
                    <img src='https://www.sendible.com/hs-fs/hubfs/Imported_Blog_Media/pinterest.png?width=180&name=pinterest.png' />
                </div>
            </div>
        </div>
    )
}

export default Footer;
